CREATE TABLE `master_player` (
  `id` bigint(21) NOT NULL AUTO_INCREMENT,
  `uid` varchar(20) DEFAULT NULL,
  `name` varchar(32) DEFAULT NULL,
  `position` varchar(32) DEFAULT NULL,
  `first_name` varchar(20) DEFAULT NULL,
  `last_name` varchar(20) DEFAULT NULL,
  `known_name` varchar(20) DEFAULT NULL,
  `birth_date` date DEFAULT NULL,
  `weight` float(3,2) DEFAULT '0.00',
  `height` float(3,2) DEFAULT '0.00',
  `jersey_num` int(3) DEFAULT '1',
  `real_position` varchar(32) DEFAULT NULL,
  `real_position_side` varchar(24) DEFAULT NULL,
  `join_date` date DEFAULT NULL,
  `country` varchar(64) DEFAULT NULL,
  `team_id` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `IDX_TEAM` (`team_id`),
  KEY `IDX_POSITION` (`real_position`,`real_position_side`)
) ENGINE=InnoDB AUTO_INCREMENT=829 DEFAULT CHARSET=utf8;

